from functools import cache
@cache
def T(n, k):
    if k < 1 or n < 1: return 0
    if k == 1: return 1
    if k == n: return n * (n + 3) * 2**(n - 3)
    return T(n-1, k) + 2*T(n-1, k-1) - T(n-2, k-2)
